from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{triple.subject} has {triple.predicate} {triple.object}"
        else:
            sentence += f", which has {triple.predicate} {triple.object}"
    return sentence + "."

